【特長】<br>●金属製（アルミ、ステンレス）のため堅牢で耐久性が高くなります。<br>●手元のレバー操作で吸着および脱着が簡単にできます。<br>●吸着力は、M10平座金の場合約0.6kg、M4×10ねじの場合約0.7kgです。<br><br>【用途】<br>●散乱したクギや混入した鉄片の回収、整理に。<br><br>【仕様】<br>●吸着力(N):40<br>●幅(mm):95<br>●奥行(mm):38<br>●高さ(mm):706.5<br><br>【材質／仕上】<br>●マグネット:フェライト磁石<br>●本体:アルミ合金・スチール・ステンレス（SUS304）<br>●吸着面:ステンレス（SUS304）<br><br>【質量】<br>590g<br><br>【JANコード】<br>4560121180068<br><br>【セット内容】<br><br>【注意】<br><br>【メーカー名】<br>（株）下西製作所<br><br>【生産国】<br>日本<style type="text/css">
